INSERT INTO `HelpArticle` VALUES (NULL,1,1,1,'购物指南',1000,NULL),(NULL,1,3,1,'支付问题',1001,NULL),(NULL,1,5,1,'售后服务',1003,NULL),(1000,2,3,1,'交易条款',1006,'<p><strong>交易条款：</strong></p><p>客户在接受商品订购与送货的同时，有义务遵守以下交易条款。您在网景下订单之前或接受商城送货之前，请您仔细阅读以下条款：</p><p>1、订购的商品价格以您下订单时网景网上价格为准。</p><p>2、 请清楚准确地填写您的真实姓名、送货地址及联系方式。因如下情况造成订单延迟或无法配送等，商城将不承担责任：</p><p>&nbsp;A. 客户提供错误信息和不详细的地址；&nbsp;</p><p>B. 货物送达无人签收，由此造成的重复配送所产生的费用及相关的后果；&nbsp;</p><p>C. 不可抗力，例如：自然灾害、交通戒严、突发战争等。&nbsp;</p><p>3、安全性：无论您是电话订购商品或是网络订购商品，我们会保证交易信息的安全，并由网景授权的员工处理您的订单。&nbsp;</p><p>4、隐私权：网景尊重您的隐私权，在任何情况下，我们都不会将您的个人和订单信息出售或泄露给任何第三方（国家司法机关调取除外）。我们从网站上或电话中得到的所有客户信息仅用来处理您的相关订单。&nbsp;</p><p>5、免责：如因不可抗力或其它网景无法控制的原因使网景销售系统崩溃或无法正常使用导致网上交易无法完成或丢失有关的信息、记录等，网景会尽可能合理地协助处理善后事宜，并努力使客户免受经济损失。&nbsp;</p><p>6、客户监督：网景希望通过不懈努力，为客户提供最佳服务，网景在给客户提供服务的全过程中接受客户的监督。&nbsp;</p><p>7、争议处理：如果客户与商城之间发生任何争议，可依据当时双方所认定的协议及相关法律进行解决。</p>'),(1000,2,2,1,'购物流程',1007,'<p><strong>第一步 注册成为会员</strong></p><p><strong>第二步 使用会员登录</strong></p><p><strong>第三步 &nbsp;查找商品&nbsp;</strong></p><p><strong>通过网站搜索、分类功能或者在商家店铺找到您需要购买的商品</strong></p><p><strong>第四部 加入购物车</strong></p><p><strong>商品放入购物车后去结算或者继续购物</strong></p><p><strong>第五步 到购物车结算</strong></p><p><strong>第六步 选择或者填写收货地址</strong></p><p><strong>第七步 选择支付方式并付款</strong></p><p><strong>第八步 收货确认及评价</strong></p>'),(1001,2,1,1,'支付流程',1008,'<p><strong>支付流程：</strong></p><p><strong>1、怎么使用支付宝支付？</strong></p><p>在您提交订单之后，页面会跳转到支付方式的选择，您选择支付宝支付即可。</p><p><strong>2、怎么使用微信支付？</strong></p><p>&nbsp;在您提交订单之后，页面会跳转到支付方式的选择，您选择微信支付即可。</p><p><strong>3、订单已提交成功，怎么付款？</strong></p><p>付款方式分为以下几种：（注：先款订单请您在订单提交后72小时内完成支付， 否则订单会自动取消）&nbsp;</p><p>1.货到付款：选择货到付款，在订单送达时您可选择现金、POS机刷卡、支票方式支付货款或通过扫码支付。</p><p>2.在线支付：选择在线支付，请您进入“我的订单”，点击“付款”，按提示进行操作；目前在线支付支持支付宝、微信、银行卡支付，可根据您的使用喜好进行选择。</p><p>3.公司转账：企业网银在线支付，实时到账；或者线下公司转账，请您按照提示操作转账，等待网景对账（支付+对账时效：10天）即可；</p><p>注：具体支付方式和支付时效以实际下单页面显示的为准。</p>'),(1001,2,2,1,'货到付款',1009,'<p><strong>货到付款：</strong></p><p>如您需要货到付款请先跟网景客服联系，网景审核是否允许其货到付款。</p>'),(NULL,1,6,1,'特色服务',1010,NULL),(NULL,1,2,1,'配送问题',1011,NULL),(1000,2,4,1,'发票须知',1012,'<p><strong>发票须知：</strong></p><p><strong>一、发票类型</strong></p><p>1、增值税普通发票</p><p>个人及不具有一般纳税人资格的企业客户，均可开具增值税普通发票。发票抬头可以在用户中心的发票信息中添加修改，客户在下单时如果需要更改抬头，可以在订单结算页面的 “发票信息”中进行修改。</p><p>2、增值税专用发票</p><p>增值税专用发票可作为会计凭证和纳税证明，网景对具有一般纳税人资格的客户，提供开具增值税专用发票。需开具此类发票的客户在下单时可选择“增值税专用发票”自助申请。</p><p>&nbsp;</p><p><strong>二、开票条件</strong></p><p>需要开具增值税专用发票的客户需要提供：①公司在工商注册的名称；②纳税人识别号（公司《税务登记证》的编号，一般为15位，三证合一后为统一社会信用代码，18位）；③公司的注册地址和电话；④开户银行的名称与银行账号。</p><p>&nbsp;</p><p>&nbsp;</p>'),(1010,2,1,1,'定制工具',1013,'<p>网景提供个性化的工具定制服务，如果您有定制需求，请把您的要求（例如定制需求，交货周期等）联系客服说明，以便我们更好的为您服务！</p>'),(1010,2,2,1,'开发平台对接',1014,'<p>网景拥有强大的技术支持，如您有平台业务需要和网景平台对接，请联系客服。</p>'),(1001,2,3,1,'在线支付',1015,'<p><strong>在线支付：</strong></p><p>我们为您提供了支付平台支付、网上银行转帐的在线支付方式，您可以根据您的具体情况选择合适的支付方式。</p><p><strong>一、支付平台方式</strong><br>可选择微信支付或支付宝支付。</p><p><strong>二、网上银行转帐</strong><br>通过自己所拥有的借记卡、信用卡申请开通网上银行，然后通过网上银行直接支付的方式将款项支付到众惠商城的网银账户，我们收到货款后会第一时间为您开始备货。</p><p><strong>三、付款注意事项</strong><br>第一、为了您的资金安全，不推荐您使用现金支付。<br>第二、付款完成后，请及时通知我们查帐，款到后即可为您办理相关业务。</p>'),(1001,2,4,1,'公司转账',1016,'<p><strong>公司转账：</strong></p><p>订单金额较大的情况，支持线下银行转账或汇款的方式进行支付，如果您需要通过银行转账，请在操作完成之后，及时联系客服说明。</p><p>您可以到任何一家银行办理银行汇款业务，由于网景持有的是深圳市范围内银行的公司帐户，您在其他地方银行办理汇款手续时，银行会向您收取跨行汇款手续费。</p><p>&nbsp;</p>'),(1003,2,1,1,'返修/退换货',1017,'<p><strong>退换货说明&nbsp;</strong></p><p>网景支持线下退换货，如果您购买的商品需要退换货，请联系商城客服协商退换货。</p>'),(1003,2,3,1,'退款说明',1018,'<p><strong>退款说明：</strong></p><p>1、经审核通过的退款申请，在客户退回的商品经仓库检验合格的情况下，收到退款申请之日起7-10个工作日内退款给客户。若检验未合格不予退款。此外，由于客户递交退款申请及商品退回的延迟，以及银行、支付宝等第三方支付平台办理退款周期的原因，不排除退款时间延迟的可能。</p><p>2、在网景以任何支付方式的订单退款均以原路退回的方式退款（如：下单时使用支付宝付款，退款直接退回支付宝账户）。</p><p>3、申请退款时需将打款账户及相关信息反馈给售后人员，以便及时办理您的退款。</p>'),(1011,2,2,1,'配送须知',1022,'<p><strong>配送须知：</strong></p><p>1、我们将按照订单约定的收件地址、收货人信息发货，并负责将商品送达客户指定的收件地址；</p><p>2、客户在订单提交后，若需要变更订单中的收件地址或收货人信息，应在订单出库前与网景取得联系并在双方达成一致的情况下进行地址的变更。如有因客户填写收货信息不准确，或未经网景渠道进行的地址变更，导致商品无法送达的，一切损失由客户承担。</p><p>3、由快递配送的订单，按照一般快递配送方式送货上门；由物流配送的订单，物流公司负责送货到点，不上楼，如客户要求送上楼，则由客户直接和物流公司沟通并直接支付上楼费用。</p>'),(1011,2,2,1,'配送时效',1023,'<p><strong>配送时效：</strong></p><p>常规现货商品72小时内发出，如货品需要调拨，则会晚于72小时发货</p>'),(1011,2,3,1,'配送方式',1024,'<p><strong>配送方式：</strong></p><p>大件货物选用物流发货；小件货物选择常规的快递发货（如申通、汇通、圆通等）。</p>'),(1011,2,4,1,'验货签收',1025,'<p><strong>验货签收：</strong></p><p>1、网景按照约定发货后，收货人有及时收货的义务。收货人可以本人签收商品或他人（包括门卫）代为签收商品，他人的签收视为收货人本人签收。签收即代表收货人对商品无异议。</p><p>2、验货签收时，需注意以下事项：</p><p>a.收货人务必在配送人员面前，确认货物未被拆封、无破损的情况后再签收。如外包装有挤压、变形、破损或被拆封等损坏迹象，您可拒收该货品，并及时通知网景相关人员进行处理。如您签收有明显损坏迹象的外包装后再投诉，恕我们不能受理。</p><p>b.如货物外箱贴有易碎标识，请务必当场开箱验货，若签收后发现货物破损，我们将不再受理关于此货物有误或有损坏的投诉。</p><p>c.如签收时发现货物有损坏，或货物与购买订单中不符，您可拒收。</p><p>d.在未签收并当面验货的情况下，发现货物有损，可在快递面单上注明“外包装损坏，**产品破损”，“内件损坏，本人拒收”等具体破损情况，再联系网景客服，以便我司后续理赔处理；若拒签，由物流公司返回网景，请拒签后第一时间联系网景售后人员进行相关处理。</p><p>e.若出现以上问题，请在收到货物后48小时内与网景联系。另外，为了更好保障您的权益，请在验货签收时保留商品破损的相关证明及资料（如视频、照片等）。</p>'),(1003,2,2,1,'退换货细则',1026,'<p><strong>退换货细则：</strong></p><p><strong>1、判断实际收货日期规则：网景配送上门订单、合作物流配送订单，均以物流反馈客户实际签收日期为准。</strong></p><p><strong>2、客户寄回商品时需要在包装里附有如下书面内容：</strong></p><p>&nbsp;&nbsp;&nbsp;&nbsp;1)&nbsp;&nbsp;受理单号、客户联系人及联系方式；</p><p>&nbsp;&nbsp;&nbsp;&nbsp;2)&nbsp;&nbsp;需退/换/修的商品订货号、型号、数量、退货原因。</p><p><strong>3、退换货需提供证明材料：</strong></p><p>&nbsp;&nbsp;&nbsp;&nbsp;1)&nbsp;&nbsp;整个包裹图片、发货清单图片、产品外包装图片和产品细节图片；</p><p>&nbsp;&nbsp;&nbsp;&nbsp;2)&nbsp;&nbsp;为保障准确性，并提高退换货效率，证明材料不能涂画、挤压。</p><p><strong>4、运费承担：</strong></p><p>&nbsp;&nbsp;&nbsp;&nbsp;1)&nbsp;&nbsp;由网景引起的退换货，运费由网景承担；</p><p>&nbsp;&nbsp;&nbsp;&nbsp;2)&nbsp;&nbsp;其他原因引起的退换货，运费由客户承担。</p><p><strong>5、退换货期：如果出现商品错发需要退换货的，经确认核实后，在收到客户退回货物后将第一时间处理客户补发或退款事宜。</strong></p><p><strong>6、关于发票：</strong></p><p>&nbsp;&nbsp;&nbsp;&nbsp;1)&nbsp;&nbsp;如果增值税发票已开具，客户尚未抵扣，须退还增值税发票；</p><p>&nbsp;&nbsp;&nbsp;&nbsp;2)&nbsp;&nbsp;如果已经抵扣，请提供《开具红字增值税专用发票申请单》；</p><p>&nbsp;&nbsp;&nbsp;&nbsp;3)&nbsp;&nbsp;如以上不能提供，客户需承担由此产生的税金损失, 即发票含税金额的13%。</p>'),(1000,2,4,1,'商品咨询',1028,'<p><strong>商品咨询：</strong></p><p><strong>1、在网景购买商品是怎么包装的？</strong></p><p>商品包装由于商品种类大小不同都是不同的，具体以实际收到为准。</p><p><strong>2、如何查看商品性能/规格/参数？</strong></p><p>商品性能/规格/参数可以通过以下方式查看： 方案一：进入商品详情页面，在商品下方点击“商品参数”查看； 方案二：页面右侧可以联系客服咨询；</p><p><strong>3、加入购物车后，是不是该商品已经被我预定了？</strong></p><p>商品加入购物车后，此商品不属于被预定，需要以成功提交订单为准。</p>');
/*!40000 ALTER TABLE `HelpArticle` ENABLE KEYS */;
UNLOCK TABLES;

