INSERT INTO `ProductModal` VALUES ('STANLEY/史丹利 橡塑公制卷尺 ',NULL,2,'<figure class=\"image\"><img src=\"http://diegooss.oss-cn-shenzhen.aliyuncs.com/202002031233139890.jpg\"></figure><p>卷尺的主要类型为钢卷尺，其次是纤维卷尺，就是大家常常看到的皮尺，很多人说是布尺，还有就是腰围尺（裁缝尺/量衣尺都属于此类）。在我国的南方和香港地区通常称卷尺为软尺或者拉尺。其材质是PVC塑料和玻璃纤维，玻璃纤维能防止在卷尺的使用过程中被拉长。</p><p>&nbsp; &nbsp; &nbsp; &nbsp;卷尺能卷起来是因为卷尺里面装有弹簧，在拉出测量长度时，实际是拉长标尺及弹簧的长度，一旦测量完毕，卷尺里面的弹簧会自动收缩，标尺在弹簧力的作用下也跟着收缩，所以卷尺就会卷起来.</p><p>&nbsp; &nbsp; &nbsp; &nbsp;一，卷尺变形太大不会失效。为什么没失效；卷尺里的发条很长，它的完全放松到完全缩紧区间很大，卷尺的全部行程包括其中，两头都留有余量，所以卷尺不会失效。</p><p>&nbsp; &nbsp; &nbsp; &nbsp;二，拉一米长和拉二米长，拉力没什么区别；卷尺的发条很薄，缩紧时的变形量也很小，所以反作用力很小，拉尺时就感觉不到力的变化。</p><p>&nbsp; &nbsp; &nbsp; &nbsp;卷尺的“内芯”，里面有根小的一截钢片，作用就跟弹簧差不多。也可以这样想，就是玩具手枪扳机上面的那个，用来“打击”子弹的那跟小钢丝，拉出来的时候使它受力弯曲，松开后外力（指手拉的力，而摩擦力较小，小于了小钢丝的弹力）消失，所以再自动弹回。 而卷尺上最前面有个折叠的那一部分，这时候就起作用了，使卷尺卡在外面，使它不会完全缩进去。 一开始他是松的，拉出来后他就变紧了，松手后它应该就有个复原的过程，所以再自动弹回。 就是他最开始里面就是松的，拉的时候就紧了，之间有个弹力，再松开自然就有弹回去。</p>','2020-02-03 12:33:52',1004,'2020-02-12 11:01:25',1000,'http://diegooss.oss-cn-shenzhen.aliyuncs.com/202002121003032538.jpg,http://diegooss.oss-cn-shenzhen.aliyuncs.com/202002121003032346.jpg,blob:http://120.76.215.76:10500/cba8250b-6f63-444f-8c8d-b0c6b2c0aa5a,http://diegooss.oss-cn-shenzhen.aliyuncs.com/202002121003036810.jpg',1018,NULL,NULL,NULL,NULL,NULL,NULL),('长城精工-T型圆柄球头 内六角扳手',NULL,7,'<figure class=\"image\"><img src=\"http://diegooss.oss-cn-shenzhen.aliyuncs.com/202002031244127217.jpg\"></figure><figure class=\"image\"><img src=\"http://diegooss.oss-cn-shenzhen.aliyuncs.com/202002031244309602.jpg\"></figure><figure class=\"image\"><img src=\"http://diegooss.oss-cn-shenzhen.aliyuncs.com/202002031244569498.jpg\"></figure><figure class=\"image\"><img src=\"http://diegooss.oss-cn-shenzhen.aliyuncs.com/202002031244565491.jpg\"></figure><figure class=\"image\"><img src=\"http://diegooss.oss-cn-shenzhen.aliyuncs.com/202002031244561896.jpg\"></figure><figure class=\"image\"><img src=\"http://diegooss.oss-cn-shenzhen.aliyuncs.com/202002031244566903.jpg\"></figure><figure cl